import React, { useEffect, useState } from 'react';

const FleetPerformance = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchPerformance = async () => {
      try {
        const res = await fetch('http://localhost:5000/api/fleet/performance');
        if (!res.ok) throw new Error('Failed to fetch data');
        const result = await res.json();
        setData(result);
      } catch (err) {
        console.error(err.message);
      }
    };
    fetchPerformance();
  }, []);

  return (
    <div>
      <h2>Fleet Performance</h2>
      <table>
        <thead>
          <tr>
            <th>From</th>
            <th>To</th>
            <th>Vehicle</th>
            <th>Fuel Cost</th>
            <th>Toll Cost</th>
            <th>Driver Expense</th>
            <th>Revenue</th>
            <th>Profit</th>
            <th>Profit %</th>
          </tr>
        </thead>
        <tbody>
          {data.map((trip, index) => {
            const totalCost = trip.fuelCost + trip.tollCost + trip.driverExpense;
            const profit = trip.revenue - totalCost;
            const profitPercent = totalCost === 0 ? 0 : ((profit / totalCost) * 100).toFixed(2);
            return (
              <tr key={index}>
                <td>{trip.route?.from?.name}</td>
                <td>{trip.route?.to?.name}</td>
                <td>{trip.vehicle?.number}</td>
                <td>{trip.fuelCost}</td>
                <td>{trip.tollCost}</td>
                <td>{trip.driverExpense}</td>
                <td>{trip.revenue}</td>
                <td>{profit}</td>
                <td>{profitPercent}%</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default FleetPerformance;
